thub.com/reactor/reactor-core/milestone/125', 'labels_url': 'https://api.github.com/repos/reactor/reactor-core/milestones/125/labels', 'id': 7778479, 'node_id': 'MI_kwDOArxvBc4AdrCv', 'number': 125, 'title': '3.4.17', 'description': None, 'creator': {'login': 'simonbasle', 'id': 6986166, 'node_id': 'MDQ6VXNlcjY5ODYxNjY=', 'avatar_url': 'https://avatars.githubusercontent.com/u/6986166?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/simonbasle', 'html_url': 'https://github.com/simonbasle', 'followers_url': 'https://api.github.com/users/simonbasle/followers', 'following_url': 'https://api.github.com/users/simonbasle/following{/other_user}', 'gists_url': 'https://api.github.com/users/simonbasle/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/simonbasle/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/simonbasle/subscriptions', 'organizations_url': 'https://api.github.com/users/simonbasle/orgs', 'repos_url': 'https://api.github.com/users/simonbasle/repos', 'events_url': 'https://api.github.com/users/simonbasle/events{/privacy}', 'received_events_url': 'https://api.github.com/users/simonbasle/received_events', 'type': 'User', 'site_admin': False}, 'open_issues': 1, 'closed_issues': 5, 'state': 'open', 'created_at': '2022-03-17T16:11:27Z', 'updated_at': '2022-04-07T09:14:26Z', 'due_on': None, 'closed_at': None}, 'comments': 2, 'created_at': '2022-04-07T07:37:55Z', 'updated_at': '2022-04-07T09:28:10Z', 'closed_at': None, 'author_association': 'NONE', 'active_lock_reason': None, 'body': 'It looks like `SinkOneMulticast` keeps track of subscribers even after the disposition of corresponding subscriptions.

Here  is the repro:

```java
// Create a SinkOne
Sinks.One<Boolean> signalSink = Sinks.one();

// First set of 3 subscriptions (A1, A2, A3)
//
Disposable disposableA1 = signalSink.asMono()
    .doOnSuccess(b -> {
        System.out.println("doOnSuccessA1");
    })
    .doFinally(signalType -> {
        System.out.println("doFinallyA1:" + signalType);
    })
    .subscribe();

Disposable disposableA2 = signalSink.asMono()
    .doOnSuccess(b -> {
        System.out.println("doOnSuccessA2");
    })
    .doFinally(signalType -> {
        System.out.println("doFinallyA2:" + signalType);
    })
    .subscribe();

Disposable disposableA3 = signalSink.asMono()
    .doOnSuccess(b -> {
        System.out.println("doOnSuccessA3");
    })
    .doFinally(signalType -> {
        System.out.println("doFinallyA3:" + signalType);
    })
    .subscribe();

// Composite Disposable for first set (A1, A2, A3)
Disposable.Composite disposablesA = Disposables.composite();
disposablesA.add(disposableA1);
disposablesA.add(disposableA2);
disposablesA.add(disposableA3);

// Second set of 3 subscriptions (B1, B2, B3)
//
Disposable disposableB1 = signalSink.asMono()
    .doOnSuccess(b -> {
        System.out.println("doOnSuccessB1");
    })
    .doFinally(signalType -> {
        System.out.println("doFinallyB1:" + signalType);
    })
    .subscribe();

Disposable disposableB2 = signalSink.asMono()
    .doOnSuccess(b -> {
        System.out.println("doOnSuccessB2");
    })
    .doFinally(signalType -> {
        System.out.println("doFinallyB2:" + signalType);
    })
    .subscribe();

Disposable disposableB3 = signalSink.asMono()
    .doOnSuccess(b -> {
        System.out.println("doOnSuccessB3");
    })
    .doFinally(signalType -> {
        System.out.println("doFinallyB3:" + signalType);
    })
    .subscribe();


// Composite Disposable for second set  (B1, B2, B3)
Disposable.Composite disposablesB = Disposables.composite();
disposablesB.add(disposableB1);
disposablesB.add(disposableB2);
disposablesB.add(disposableB3);
```

As expected `SinkOneMulticast` tracks 6 subscribers (3 from the first and 3 from the second set)

<img width="497" alt="SinkOneMulticastAB" src="https://user-images.githubusercontent.com/1471612/162144048-7cc327c6-bc0d-4cd2-bc51-559f9ec86b61.png">

Now dispose of the first set (A1, A2, A3)

```java
// Dispose only the first set
disposablesA.dispose();
```

`doFinally` is invoked for the first set as expected

```
doFinallyA1:cancel
doFinallyA2:cancel
doFinallyA3:cancel
```

but `SinkOneMulticast` won't release those 3 subscribers but continues to hold reference to those

<img width="497" alt="SinkOneMulticastB" src="https://user-images.githubusercontent.com/1471612/162144109-25a18f0a-de02-4fdf-933f-de02f0dd4f84.png">

`SinkOneMulticast` keeps holding those references until the sink emits

```
signalSink.tryEmitValue(true);
```

<img width="530" alt="SinkOneMulticastCleared" src="https://user-images.githubusercontent.com/1471612/162144183-ccd1fdd9-ad3b-4431-8216-49021ff8060b.png">

The above behavior of `SinkOneMulticast` holding references to disposed subscribers blocks its GC collection. This leads to memory leaks in the applications.

The application might have different components listening (subscribed) to the SinkOne. Some of the components may not be interested in the signal at a later point and dispose the subscriptions (for example, in the component close() method). When huge number of such components are created and closed, those subscribers in SinkOne leads to memory leak.', 'reactions': {'url': 'https://api.github.com/repos/reactor/reactor-core/issues/3001/reactions', 'total_count': 0, '+1': 0, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'timeline_url': 'https://api.github.com/repos/reactor/reactor-core/issues/3001/timeline', 'performed_via_github_app': None}, 'comment': {'url': 'https://api.github.com/repos/reactor/reactor-core/issues/comments/1091421782', 'html_url': 'https://github.com/reactor/reactor-core/issues/3001#issuecomment-1091421782', 'issue_url': 'https://api.github.com/repos/reactor/reactor-core/issues/3001', 'id': 1091421782, 'node_id': 'IC_kwDOArxvBc5BDcZW', 'user': {'login': 'JonathanGiles', 'id': 1427840, 'node_id': 'MDQ6VXNlcjE0Mjc4NDA=', 'avatar_url': 'https://avatars.githubusercontent.com/u/1427840?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/JonathanGiles', 'html_url': 'https://github.com/JonathanGiles', 'followers_url': 'https://api.github.com/users/JonathanGiles/followers', 'following_url': 'https://api.github.com/users/JonathanGiles/following{/other_user}', 'gists_url': 'https://api.github.com/users/JonathanGiles/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/JonathanGiles/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/JonathanGiles/subscriptions', 'organizations_url': 'https://api.github.com/users/JonathanGiles/orgs', 'repos_url': 'https://api.github.com/users/JonathanGiles/repos', 'events_url': 'https://api.github.com/users/JonathanGiles/events{/privacy}', 'received_events_url': 'https://api.github.com/users/JonathanGiles/received_events', 'type': 'User', 'site_admin': False}, 'created_at': '2022-04-07T09:28:10Z', 'updated_at': '2022-04-07T09:28:10Z', 'author_association': 'NONE', 'body': 'Thanks @simonbasle! ', 'reactions': {'url': 'https://api.github.com/repos/reactor/reactor-core/issues/comments/1091421782/reactions', 'total_count': 0, '+1': 0, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'performed_via_github_app': None}}

