```java
public long size() {
    if (this.isVirtualDirectory) {
        return 0;
    }
    return properties.getBlobSize();
}
```

In some projects, we even had a code style expectation that such simple return statements didn't need to have braces, so we would have made it simpler and on one line, as below:

```java
public long size() {
    if (this.isVirtualDirectory) return 0;
    return properties.getBlobSize();
}
```

Of course, at this point we might as well go the whole way and just do a single-line ternary expression:

```java
public long size() {
    return this.isVirtualDirectory ? 0 : properties.getBlobSize();
}
